DROP TABLE IF EXISTS animal;
CREATE TABLE `animal` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name_animal` varchar(255) NOT NULL,
  `diet_animal` varchar(255) NOT NULL,
  `status_animal` varchar(255) NOT NULL,
  `family_animal` varchar(255) NOT NULL,
  `population_animal` varchar(255) NOT NULL,
  `description_animal` varchar(255) NOT NULL,
  `nickname_animal` varchar(255) NOT NULL,
  `main_picture_animal` varchar(255) NOT NULL,
  `appearance_animal` varchar(255) NOT NULL,
  `legs_animal` int(11) NOT NULL,
  `social_animal` varchar(255) NOT NULL,
  `cut_out_image_animal` varchar(255) DEFAULT NULL,
  `desc_more_animal` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=55 DEFAULT CHARSET=utf8mb4 COMMENT='Définition des animaux';

DROP TABLE IF EXISTS animal_habitat;
CREATE TABLE `animal_habitat` (
  `animal_id` int(11) NOT NULL,
  `habitat_id` int(11) NOT NULL,
  PRIMARY KEY (`animal_id`,`habitat_id`),
  KEY `IDX_B4E8DDD28E962C16` (`animal_id`),
  KEY `IDX_B4E8DDD2AFFE2D26` (`habitat_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Relation entre animaux et habitats';

DROP TABLE IF EXISTS avatar;
CREATE TABLE `avatar` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name_avatar` varchar(255) NOT NULL,
  `url_avatar` varchar(255) NOT NULL,
  `description_avatar` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COMMENT=' Définition des avatars ';

DROP TABLE IF EXISTS badge;
CREATE TABLE `badge` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name_badge` varchar(255) NOT NULL,
  `url_badge` varchar(255) NOT NULL,
  `description_badge` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COMMENT='Définition des badges';

DROP TABLE IF EXISTS continent;
CREATE TABLE `continent` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name_continent` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8mb4 COMMENT='Définition des continents (table statique)';

DROP TABLE IF EXISTS country;
CREATE TABLE `country` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_continent_country_id` int(11) NOT NULL,
  `name_country` varchar(255) NOT NULL,
  `latitude_country` double NOT NULL,
  `longitude_country` double NOT NULL,
  PRIMARY KEY (`id`),
  KEY `IDX_5373C9662372C463` (`id_continent_country_id`)
) ENGINE=MyISAM AUTO_INCREMENT=253 DEFAULT CHARSET=utf8mb4 COMMENT='Définition des pays (table statique)';

DROP TABLE IF EXISTS doctrine_migration_versions;
CREATE TABLE `doctrine_migration_versions` (
  `version` varchar(191) NOT NULL,
  `executed_at` datetime DEFAULT NULL,
  `execution_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`version`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COMMENT='Versions de migrations';

DROP TABLE IF EXISTS habitat;
CREATE TABLE `habitat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name_habitat` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=15 DEFAULT CHARSET=utf8mb4 COMMENT='Définition des habitats';

DROP TABLE IF EXISTS picture;
CREATE TABLE `picture` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `animal_id` int(11) NOT NULL,
  `url_picture` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `IDX_16DB4F898E962C16` (`animal_id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COMMENT='Relation photo animal';

DROP TABLE IF EXISTS pin;
CREATE TABLE `pin` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_region_pin_id` int(11) NOT NULL,
  `id_animal_pin_id` int(11) NOT NULL,
  `longitude_pin` double NOT NULL,
  `latitude_pin` double NOT NULL,
  `style_pin` varchar(255) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `IDX_B5852DF3C1C7087C` (`id_region_pin_id`),
  KEY `IDX_B5852DF368E231F5` (`id_animal_pin_id`)
) ENGINE=MyISAM AUTO_INCREMENT=64 DEFAULT CHARSET=utf8mb4 COMMENT=' Définition des pins';

DROP TABLE IF EXISTS question;
CREATE TABLE `question` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name_question` varchar(255) NOT NULL,
  `response_1_question` varchar(255) NOT NULL,
  `response_2_question` varchar(255) NOT NULL,
  `response_3_question` varchar(255) NOT NULL,
  `response_4_question` varchar(255) NOT NULL,
  `answer_question` varchar(255) NOT NULL,
  `point_question` varchar(255) NOT NULL,
  `difficulty_question` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COMMENT=' Définition des questions';

DROP TABLE IF EXISTS region;
CREATE TABLE `region` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_country_region_id` int(11) NOT NULL,
  `name_region` varchar(255) NOT NULL,
  `latitude_region` double DEFAULT NULL,
  `longitude_region` double DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `IDX_F62F176DCF26C22` (`id_country_region_id`)
) ENGINE=MyISAM AUTO_INCREMENT=4156 DEFAULT CHARSET=utf8mb4 COMMENT='Définition des régions (table statique)';

DROP TABLE IF EXISTS trophy;
CREATE TABLE `trophy` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name_trophy` varchar(255) NOT NULL,
  `url_trophy` varchar(255) NOT NULL,
  `description_trophy` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COMMENT='Définition des trophées';

DROP TABLE IF EXISTS user;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `id_avatar_user_id` int(11) DEFAULT NULL,
  `id_badge_user_id` int(11) DEFAULT NULL,
  `login_user` varchar(180) NOT NULL,
  `roles` json DEFAULT NULL,
  `password` varchar(255) NOT NULL,
  `email_user` varchar(255) NOT NULL,
  `name_user` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `UNIQ_8D93D6494BE15D0C` (`login_user`),
  KEY `IDX_8D93D6494C66614D` (`id_avatar_user_id`),
  KEY `IDX_8D93D6491FC20B4C` (`id_badge_user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COMMENT=' Définition des users';

DROP TABLE IF EXISTS user_animal;
CREATE TABLE `user_animal` (
  `user_id` int(11) NOT NULL,
  `animal_id` int(11) NOT NULL,
  PRIMARY KEY (`user_id`,`animal_id`),
  KEY `IDX_FF93822A76ED395` (`user_id`),
  KEY `IDX_FF938228E962C16` (`animal_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Relation user animal';

DROP TABLE IF EXISTS user_trophy;
CREATE TABLE `user_trophy` (
  `user_id` int(11) NOT NULL,
  `trophy_id` int(11) NOT NULL,
  PRIMARY KEY (`user_id`,`trophy_id`),
  KEY `IDX_7478E1D4A76ED395` (`user_id`),
  KEY `IDX_7478E1D4F59AEEEF` (`trophy_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COMMENT=' Relation users trophées';




